import React from 'react';
import { Route,Switch } from 'react-router-dom';
import { Sign_In } from './authorization/sign_in';

export const Root = (props : any) => {
    return (
        <Switch>
            <Route exact path = "/">
                    <Sign_In />
            </Route>
        </Switch>
    );
}
